(2718, 'opt_fl_text1', 0, 'Are you looking for a cheap car rental for your stay in Marrakech? Our agency is located 15 minutes from Marrakech airport has a car park made up of recent and air-conditioned vehicles and 4x4s. Provides you with car rental in Marrakech, Essaouira, Fez, Casablanca, Agadir and in Morocco, Do not hesitate to make your reservations in order to take advantage of one of the cheapest car rentals on the market. Renting a vehicle with us means benefiting from cheap car rental in Marrakech.', 'en', 0),
