(5623, 'opt_fl_text3', 1, 'Notre Agence de Location 4x4 Marrakech vous propose un Parc de 4x4 jeune et varié sur l\'aeroport de Marrakech pour combler vos désirs que vous soyez en voyage d\'affaire, en famille ou même entre amis on a le véhicule 4x4 qu\'il vos faut, a des prix très compétitifs. Partez à la découverte de la ville de Marrakech et profiter pleinement de vos vacances grâce a notre service de location 4x4 Marrakech, des spécialistes de Location voiture Marrakech vous attends pour vous servir.\r\n', 'fr', 0),
(2720, 'opt_fl_text3', 0, 'Our Marrakech 4x4 Rental Agency offers you a young and varied 4x4 Park on Marrakech airport to fulfill your desires whether you are on a business trip, with family or even between friends we have the 4x4 vehicle you need , at very competitive prices. Discover the city of Marrakech and fully enjoy your vacation thanks to our Marrakech 4x4 rental service, Marrakech car rental specialists are waiting to serve you.', 'en', 0),
(2721, 'opt_fl_text4', 0, 'You can live in the culture of Morocco by visiting Marrakech. You will surely find what you want in Marrakech and the welcoming people of Morocco will welcome you. Djamaa El Fenn is just a 10 minute driving from <strong>Marrakech Menara Airport</strong> and we can arrange a transfer directly to and from the hotel for your arrival and departure. Exploring the city is easy Because all the sites of the medina are easily accessible on foot. Also visit the magnificent Koranic college Ben Youssef Medersa, the old Jewish quarter. Then, of course, there are world famous souks, filled with everything.', 'en', 0),
