(2761, 'home_meta_title', 1, 'Location de voitures Marrakech – Location fiable & abordable', 'fr', 0),
(2739, 'car_uses', 1, 'Utilisation de la voiture', 'fr', 0),
(2740, 'car_uses', 0, 'Car Uses', 'en', 0),
(2741, 'car_uses_text', 1, 'Le locataire ,lui seul est amené à conduire la vehicule de location Marrakech,dont il se porte garant et ne doit l’utiliser que pour ses besoins personnels.           L’agence interdit strictement le locataire à participer à toute compétition et d’utiliser le véhicule a des fins illicites ou des transports de marchandises.           Le locataire doit s’engager a ne pas solliciter des documents douaniers.            Il est interdit au locataire de surcharger le véhicule loué en transportant un nombre de passagers supérieur à celui indiqué sur le contrat  sous peine d’être déchu de l’assurance.', 'fr', 0),
(2742, 'car_uses_text', 0, 'The tenant, he alone is required to drive the Marrakech rental vehicle, which he vouches for and must only use for his personal needs. The agency strictly prohibits the tenant from participating in any competition and from using the vehicle for illicit purposes or the transport of goods. The tenant must agree not to request customs documents. The tenant is prohibited from overloading the rented vehicle by transporting a number of passengers greater than that indicated on the contract under penalty of being forfeited from the insurance.', 'en', 0),
(2743, 'car_condition', 1, 'Etat de la voiture & responsabilité', 'fr', 0),
(2744, 'car_condition', 0, 'Car condition & Responsability', 'en', 0),
(2745, 'car_condition_text', 1, 'Le vehicule se livre en tres bon  état de marche et de propreté  et  le locataire devra acquitter le montant  de remise en état. Ainsi il demeure seul responsable des amendes, contravention et procès verbaux établis contre lui.', 'fr', 0),
(2746, 'car_condition_text', 0, 'The vehicle is delivered in very good working order and cleanliness and the tenant will have to pay the amount of restoration. Thus he remains solely responsible for the fines, contravention and minutes drawn up against him.', 'en', 0),
(2747, 'insurance', 1, 'Assurance', 'fr', 0),
(2748, 'insurance', 0, 'Insurance', 'en', 0),
(2749, 'insurance_text', 1, 'Les vehicules Jacarandacar pour la location des voitures sont assurés tout risques , bien entendu le vehicule , vol ,brice de glace, conducteurs et passagers.', 'fr', 0),
(2750, 'insurance_text', 0, 'Jacarandacar vehicles for car rental has insurance all risques, of course the vehicle, theft, broken glass, drivers and passengers.', 'en', 0),
