(2752, 'booking_delivery', 0, 'Booking & Delivery', 'en', 0),
(2753, 'booking_delivery_text', 1, 'Réservez chez Jacarandacar en ligne et beneficiez de nos promos de tous les jours. Jacarandacar assure la livraison des vehicules à l’aeroport, hotel et à l’agence JACARANDACAR gratuitement 7/7 et 24/24. Toute information supplémentaire par rapport a la reservation serait communiquée au locataire apres la reservation.', 'fr', 0),
