(6610, 'footer_menu_link1', 0, 'https://jacarandacar.com/', 'es', 0),
(6611, 'opt_fl_text3', 0, 'Notre Agence de Location 4x4 Marrakech vous propose un Parc de 4x4 jeune et varié sur l\'aeroport de Marrakech pour combler vos désirs que vous soyez en voyage d\'affaire, en famille ou même entre amis on a le véhicule 4x4 qu\'il vos faut, a des prix très compétitifs. Partez à la découverte de la ville de Marrakech et profiter pleinement de vos vacances grâce a notre service de location 4x4 Marrakech, des spécialistes de Location voiture Marrakech vous attends pour vous servir.\r\n', 'es', 0),
(6612, 'bottom_bar', 0, 'JACARANDACAR | Alquiler de coches en Marrakech con compra de franquicia barata', 'es', 0),
(6613, 'home_meta_title', 0, 'Alquiler de coches Marrakech – Confiable y Económico Jacarandacar', 'es', 0),
(6614, 'car_uses', 0, 'Utilisation de la voiture', 'es', 0),
(6615, 'car_uses_text', 0, 'Le locataire ,lui seul est amené à conduire la vehicule de location Marrakech,dont il se porte garant et ne doit l’utiliser que pour ses besoins personnels.           L’agence interdit strictement le locataire à participer à toute compétition et d’utiliser le véhicule a des fins illicites ou des transports de marchandises.           Le locataire doit s’engager a ne pas solliciter des documents douaniers.            Il est interdit au locataire de surcharger le véhicule loué en transportant un nombre de passagers supérieur à celui indiqué sur le contrat  sous peine d’être déchu de l’assurance.', 'es', 0),
(6616, 'car_condition', 0, 'Etat de la voiture & responsabilité', 'es', 0),
(6617, 'car_condition_text', 0, 'Le vehicule se livre en tres bon  état de marche et de propreté  et  le locataire devra acquitter le montant  de remise en état. Ainsi il demeure seul responsable des amendes, contravention et procès verbaux établis contre lui.', 'es', 0),
(6618, 'insurance', 0, 'Assurance', 'es', 0),
(6619, 'insurance_text', 0, 'Les vehicules Jacarandacar pour la location des voitures sont assurés tout risques , bien entendu le vehicule , vol ,brice de glace, conducteurs et passagers.', 'es', 0),
(6620, 'booking_delivery', 0, 'Réservation & livraison', 'es', 0),
(6621, 'booking_delivery_text', 0, 'Réservez chez Jacarandacar en ligne et beneficiez de nos promos de tous les jours. Jacarandacar assure la livraison des vehicules à l’aeroport, hotel et à l’agence JACARANDACAR gratuitement 7/7 et 24/24. Toute information supplémentaire par rapport a la reservation serait communiquée au locataire apres la reservation.', 'es', 0),
(6622, 'from_2', 0, 'De', 'es', 0),
(6623, 'client_info', 0, 'Cliente de información', 'es', 0),
(6624, 'booking_mail_subject', 0, 'Solicitud de Reserva', 'es', 0),
(6625, 'home_meta_description', 0, 'Descubre Marrakech con Alquiler de Coches Jacarandacar. Disfruta de opciones de alquiler confiables, económicas y sin complicaciones. ¡Reserva tu coche ideal hoy mismo!', 'es', 0),
(6626, 'footer_menu_link1', 0, 'https://jacarandacar.com/', 'es', 0),
(6627, 'read_more', 0, 'Lire plus >>', 'es', 0),
(6628, 'h1_man_auto', 0, 'Alquiler de coches manuales y automáticos en Marrakech', 'es', 0),
(6629, 'title_man_auto', 0, 'Alquiler de coches automáticos y manuales Marrakech || Agencia de alquiler de coches en Marrakech', 'es', 0),
(6630, 'description_man_auto', 0, 'Si está buscando un coche de alquiler automático o manual, Jacarandacar es la dirección adecuada para usted con una reserva simple y confiable.', 'es', 0),
(6631, 'description_caution', 0, 'El alquiler de coches en Marrakech sin depósito es posible con Jacarandacar que ofrece a sus clientes las mejores ofertas de alquiler de coches en Marrakech', 'es', 0),
(6632, 'h1_caution', 0, 'Alquiler de coches en Marrakech sin depósito', 'es', 0),
(6633, 'title_caution', 0, 'Alquiler de coches en Marrakech sin deposito || Jacarandacar', 'es', 0),
(6634, 'description_airport', 0, 'Necesitas un coche de alquiler barato en Marrakech? Nuestra agencia de alquiler de coches en Marrakech ofrece alquiler de coches en el aeropuerto de Marrakech, alquiler de vehículos, Económico, SUV...', 'es', 0),
(6635, 'title_airport', 0, 'Alquiler de coches en el aeropuerto de Marrakech || Agencia de alquiler de coches en Marrakech', 'es', 0),
(6636, 'contact_title', 0, 'Contáctanos – Alquiler de coches Jacaranda Marrakech', 'es', 0),
(6637, 'site_contact_description', 0, 'Ponte en contacto con Alquiler de Coches Jacaranda Marrakech para consultas, reservas o asistencia. Encuentra nuestra información de contacto, incluyendo números de teléfono y direcciones de correo electrónico, y contáctanos para recibir ayuda.', 'es', 0),
(6638, 'general_conditions_title', 0, 'Alquiler de coches Jacarandacar Marrakech – Condiciones generales de alquiler', 'es', 0),
(6639, 'h1_airport', 0, 'Alquiler de coches aeropuerto de Marrakech', 'es', 0),
(6640, 'general_conditions_description', 0, 'Revisa las condiciones generales de alquiler de Alquiler de Coches Jacarandacar Marrakech. Conoce nuestras políticas, requisitos y términos para asegurar una experiencia de alquiler sin problemas.', 'es', 0),
(6641, 'parc_title', 0, 'Alquiler coches marrakech – Nuestra flota de vehículos', 'es', 0),
(6642, 'parc_description', 0, 'Explora nuestra variada flota de vehículos en Alquiler de Coches Jacarandacar Marrakech. Encuentra el coche perfecto para tus necesidades, desde vehículos compactos hasta SUV. Navega y reserva hoy mismo.', 'es', 0),
