(8749, 'opt_fl_text3', 0, 'Notre Agence de Location 4x4 Marrakech vous propose un Parc de 4x4 jeune et varié sur l\'aeroport de Marrakech pour combler vos désirs que vous soyez en voyage d\'affaire, en famille ou même entre amis on a le véhicule 4x4 qu\'il vos faut, a des prix très compétitifs. Partez à la découverte de la ville de Marrakech et profiter pleinement de vos vacances grâce a notre service de location 4x4 Marrakech, des spécialistes de Location voiture Marrakech vous attends pour vous servir.\r\n', 'pl', 0),
(8750, 'bottom_bar', 0, 'JACARANDACAR | Wynajem samochodów w Marrakeszu z tanim ubezpieczeniem dedykowanym do wykupu własnego udziału w szkodzie', 'pl', 0),
(8751, 'home_meta_title', 0, 'Wynajem Samochodów Jacarandacar Marrakech – Niezawodny i Tani', 'pl', 0),
(8752, 'car_uses', 0, 'Utilisation de la voiture', 'pl', 0),
(8753, 'car_uses_text', 0, 'Le locataire ,lui seul est amené à conduire la vehicule de location Marrakech,dont il se porte garant et ne doit l’utiliser que pour ses besoins personnels.           L’agence interdit strictement le locataire à participer à toute compétition et d’utiliser le véhicule a des fins illicites ou des transports de marchandises.           Le locataire doit s’engager a ne pas solliciter des documents douaniers.            Il est interdit au locataire de surcharger le véhicule loué en transportant un nombre de passagers supérieur à celui indiqué sur le contrat  sous peine d’être déchu de l’assurance.', 'pl', 0),
(8754, 'car_condition', 0, 'Etat de la voiture & responsabilité', 'pl', 0),
(8755, 'car_condition_text', 0, 'Le vehicule se livre en tres bon  état de marche et de propreté  et  le locataire devra acquitter le montant  de remise en état. Ainsi il demeure seul responsable des amendes, contravention et procès verbaux établis contre lui.', 'pl', 0),
(8756, 'insurance', 0, 'Assurance', 'pl', 0),
(8757, 'insurance_text', 0, 'Les vehicules Jacarandacar pour la location des voitures sont assurés tout risques , bien entendu le vehicule , vol ,brice de glace, conducteurs et passagers.', 'pl', 0),
(8758, 'booking_delivery', 0, 'Réservation & livraison', 'pl', 0),
(8759, 'booking_delivery_text', 0, 'Réservez chez Jacarandacar en ligne et beneficiez de nos promos de tous les jours. Jacarandacar assure la livraison des vehicules à l’aeroport, hotel et à l’agence JACARANDACAR gratuitement 7/7 et 24/24. Toute information supplémentaire par rapport a la reservation serait communiquée au locataire apres la reservation.', 'pl', 0),
