(8768, 'description_man_auto', 0, 'Si vous recherchez une voiture de location automatique ou manuelle, Jacarandacar est la bonne adresse pour vous avec une réservation simple et fiable', 'pl', 0),
(8769, 'description_caution', 0, 'Możliwe jest wynajęcie samochodu w Marrakeszu bez kaucji dzięki Jacarandacar, który oferuje swoim klientom najlepsze oferty na wynajem samochodów w Marrakeszu.', 'pl', 0),
