(8771, 'title_caution', 0, 'Klientów wypożyczalni samochodów w Marrakeszu bez kaucji || Jacarandacar', 'pl', 0),
(8772, 'description_airport', 0, 'Potrzebujesz taniego wynajmu samochodów w Marrakeszu? Nasze biuro wynajmu samochodów w Marrakeszu oferuje wynajem samochodów na lotnisku w Marrakeszu, wynajem pojazdów, ekonomiczne, SUV...', 'pl', 0),
(8773, 'title_airport', 0, 'Wypożyczalnia samochodów lotnisko Marrakesz || Agencja wynajmu samochodów Marrakesz', 'pl', 0),
(8774, 'contact_title', 0, 'ntaktuj się z nami – Wynajem samochodów Jacaranda Marrakech', 'pl', 0),
(8775, 'site_contact_description', 0, 'Skontaktuj się z wynajem samochodów Jacaranda Marrakech w celu zapytań, rezerwacji lub wsparcia. Znajdź nasze dane kontaktowe, w tym numery telefonów i adresy e-mail, i skontaktuj się z nami, aby uzyskać pomoc.', 'pl', 0),
