(9757, 'opt_fl_title4', 0, 'Uw verblijf in Marrakech', 'nl', 0),
(9758, 'opt_fl_text1', 0, 'Vous souhaitez trouver une location de voiture pas cher pour votre séjour à Marrakech ? Notre agence est située à 15 minutes de l\'aéroport de Marrakech dispose d’un parc auto composé de véhicules et 4x4 récents et climatisés .vous assure à la location de voitures à Marrakech, Essaouira, Fès, Casablanca , Agadir et au Maroc, N’hésitez pas à passer vos réservations afin de profiter d’une location de voiture parmi les moins chers du marché . Louer un véhicule chez nous, c\'est bénéficier de la location de voiture pas cher à Marrakech.', 'nl', 0),
(9759, 'opt_fl_text2', 0, 'Pour votre séjour au Maroc, une seule adresse: Jacaranda Car - location voiture Marrakech , spécialisée dans la location de voitures, 4x4 à Marrakech , vous propose des véhicules de location et de qualité à des prix très compétitifs. Une location de voiture à Marrakech vous permettra de découvrir le Maroc. Quelle que soit la durée de votre séjour, louer un véhicule à Marrakech et faire de vos voyages des expériences réussies. Profitez de attractifs, d’un service de grande qualité et d’un vaste choix de véhicules neufs.\r\n', 'nl', 0),
(9760, 'opt_fl_text3', 0, 'Notre Agence de Location 4x4 Marrakech vous propose un Parc de 4x4 jeune et varié sur l\'aeroport de Marrakech pour combler vos désirs que vous soyez en voyage d\'affaire, en famille ou même entre amis on a le véhicule 4x4 qu\'il vos faut, a des prix très compétitifs. Partez à la découverte de la ville de Marrakech et profiter pleinement de vos vacances grâce a notre service de location 4x4 Marrakech, des spécialistes de Location voiture Marrakech vous attends pour vous servir.', 'nl', 0),
(9761, 'h1_qat', 0, 'Verhuur van 4x4 in Marrakech', 'nl', 0),
(9762, 'title_qat', 0, '4x4-verhuur in Marrakech || Autoverhuurbedrijf Marrakech', 'nl', 0),
(9763, 'description_qat', 0, 'Marrakech, dat u een breed scala aan goedkope auto\'s, 4x4\'s en SUV\'s biedt en haar expertise en professionaliteit tot uw beschikking stelt.', 'nl', 0),
(9764, 'opt_fl_text4', 0, 'U verblijft in <b>Marrakech</b> en bent op zoek naar <a href=\"#\"><b>een huurauto</b></a>. Jacaranda Car, een autoverhuurbedrijf in Marrakech, biedt u een wagenpark met auto\'s van alle categorieën tegen de laagste prijzen op de markt. Jacaranda Car is een autoverhuurbedrijf en 4x4-verhuurbedrijf gevestigd in Marrakech om aan uw behoeften op het gebied van autoverhuur te voldoen. Wij beschikken over een assortiment auto\'s van alle categorieën, van economisch en SUV tot gezinsauto\'s en luxevoertuigen.', 'nl', 0),
