(11058, 'car_uses', 0, 'Utilisation de la voiture', 'pt', 0),
(11059, 'car_uses_text', 0, 'Le locataire ,lui seul est amené à conduire la vehicule de location Marrakech,dont il se porte garant et ne doit l’utiliser que pour ses besoins personnels.           L’agence interdit strictement le locataire à participer à toute compétition et d’utiliser le véhicule a des fins illicites ou des transports de marchandises.           Le locataire doit s’engager a ne pas solliciter des documents douaniers.            Il est interdit au locataire de surcharger le véhicule loué en transportant un nombre de passagers supérieur à celui indiqué sur le contrat  sous peine d’être déchu de l’assurance.', 'pt', 0),
(11060, 'car_condition', 0, 'Etat de la voiture & responsabilité', 'pt', 0),
(11061, 'car_condition_text', 0, 'Le vehicule se livre en tres bon  état de marche et de propreté  et  le locataire devra acquitter le montant  de remise en état. Ainsi il demeure seul responsable des amendes, contravention et procès verbaux établis contre lui.', 'pt', 0),
(11062, 'insurance', 0, 'Assurance', 'pt', 0),
(11063, 'insurance_text', 0, 'Les vehicules Jacarandacar pour la location des voitures sont assurés tout risques , bien entendu le vehicule , vol ,brice de glace, conducteurs et passagers.', 'pt', 0),
(11064, 'booking_delivery', 0, 'Réservation & livraison', 'pt', 0),
(11065, 'booking_delivery_text', 0, 'Réservez chez Jacarandacar en ligne et beneficiez de nos promos de tous les jours. Jacarandacar assure la livraison des vehicules à l’aeroport, hotel et à l’agence JACARANDACAR gratuitement 7/7 et 24/24. Toute information supplémentaire par rapport a la reservation serait communiquée au locataire apres la reservation.', 'pt', 0),
